import React from 'react'
import flavor from './flavor.png'
import garlic from './garlic.png'

const Logo = props => {
    return (
        <div>
            <img style={styles.flavor} src={flavor} alt="logo"/>
            <img style={styles.garlic} src={garlic} alt="garlic"/>
        </div>
    )
};

export default Logo

const styles = {
    flavor: {
        width: '50%',
        marginTop: '5%',
        padding: '0',
        border: 'solid red 1px'
    },
    garlic: {
        float: 'left',
        width: '10%'
    }
};
